    if (!email.trim()) newErrors.email = "Email kh√¥ng ƒë∆∞·ª£c ƒë·ªÉ tr·ªëng";
    else if (!/\S+@\S+\.\S+/.test(email)) newErrors.email = "Email kh√¥ng h·ª£p l·ªá";
    setErrors(newErrors);
    return Object.keys(newErrors).length === 0;
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    if (!validate()) return;

    setLoading(true);
    try {
      await axios.post(
        "http://localhost:3000/users",
        {
          name,
          email,
          role,
          password: "123456",
        },
        {
          headers: {
            Authorization: `Bearer ${token}`, // üß© g·ª≠i token JWT
          },
        }
      );


      setName("");
      setEmail("");
      setRole("user");
      setErrors({});
      onAdd();
    } catch (err) {
      console.error("Th√™m user l·ªói:", err);
    }
    setLoading(false);
  };

  const styles = {
    container: {
      background: "#fff",
      padding: "40px",
      margin: "40px auto",
      borderRadius: "20px",
      boxShadow: "0 12px 30px rgba(0,0,0,0.1)",
      maxWidth: "450px",
      fontFamily: "Inter, sans-serif",
    },
    title: {
      marginBottom: "25px",
      color: "#1f2937",
      fontWeight: "700",
      fontSize: "24px",
      textAlign: "center",
    },
    input: {
