      fontSize: "15px",
      outline: "none",
      transition: "border 0.2s ease",
      boxSizing: "border-box",
    },
    select: {
      width: "100%",
      height: "48px",
      padding: "0 12px",
      marginBottom: "10px",
      borderRadius: "12px",
      border: "1px solid #d1d5db",
      fontSize: "15px",
      outline: "none",
      backgroundColor: "#fff",
    },
    inputError: {
      border: "1px solid #ef4444",
    },
    errorText: {
      color: "#ef4444",
      fontSize: "13px",
      marginBottom: "10px",
    },
    button: {
      width: "100%",
      padding: "14px",
      background: "linear-gradient(135deg, #4f46e5, #3b82f6)",
      color: "#fff",
      border: "none",
      borderRadius: "16px",
      fontSize: "16px",
      fontWeight: "600",
      cursor: loading ? "not-allowed" : "pointer",
      opacity: loading ? 0.7 : 1,
